import 'dart:convert';
import 'dart:io' as Io;

class Emploi {

  String titreOffre;
  String logo;
  String typeContrat;
  String aPourvoirLe;
  String communeEmploi;
  String url;

  String DEFAULT_LOGO = "";
  Emploi({
    this.titreOffre,
    this.logo,
    this.typeContrat,
    this.aPourvoirLe,
    this.communeEmploi,
    this.url
  });

  factory Emploi.fromJson(Map<String, dynamic> json) =>
    new Emploi(
      titreOffre: json['titreOffre'],
      typeContrat: json['typeContrat'],
      logo: json['employeur']['logo'],
      aPourvoirLe: json['aPourvoirLe'],
      communeEmploi : json['communeEmploi'],
      url: json['url']
    );

  decodeLogo(){
    return this.logo != null ? base64.decode(this.logo) : base64.decode(DEFAULT_LOGO);
  }

}